INSERT INTO `wp_em_events` VALUES (1,21,'a-beginners-guide-to-wordpress',2,1,'Intro to WordPress Workshop','10:00:00','12:00:00',0,'2014-08-02','2014-08-02','This one day workshop, taught by <a href=\"http://casabona.org/\">Joe Casabona</a>, will take you through how to use WordPress, from setting up a WordPress site, to creating posts and pages, to managing users and everything in between. Topics covered include:\r\n<ul>\r\n	<li>What is WordPress?</li>\r\n	<li>The difference between Org and Com</li>\r\n	<li>Creating Posts and Pages</li>\r\n	<li>Categories vs. Tags</li>\r\n	<li>Uploading Media</li>\r\n	<li>Comments</li>\r\n	<li>Widgets and Menus</li>\r\n	<li>Themes and Plugins</li>\r\n	<li>Managing Users</li>\r\n	<li>The Settings</li>\r\n</ul>\r\n...and much more! If you\'ve ever wanted to learn WordPress, set up your own website, or have a blog, this is the Workshop for you!\r\n\r\nThere are also two types of tickets: A standard ticket, which will give you admission to the workshop, and an advanced ticket that will give you access to a set of videos produced by WP101 after the workshop is over. You will have access to these videos for up to 8 months after the workshop is over.\r\n<h3>Register Now!</h3>\r\n[gravityform id=\"1\" name=\"Intro WordPress Registration\" description=\"false\" title=\"false\"]',0,'2014-07-10','00:00:00',0,0,0,1,NULL,NULL,'a:0:{}','2014-06-10 21:28:07','2014-07-09 08:02:21',0,NULL,NULL,NULL,NULL,0,NULL,0);
