INSERT INTO `wp_em_events` VALUES (3,64,'intro-photography',2,1,'Intro to Photography','10:00:00','12:00:00',0,'2014-08-16','2014-08-16','In this One Day Workshop, <a href=\"http://phil.casabona.org\">Phil Casabona</a> will show you some Critical aspects of photography and camera information in order to take great photos. The focus will be on digital black and white photography and the Workshop will last around an hour and half, followed by taking some time downtown and on campus to take photos. Come by to learn all about:\r\n<ul>\r\n	<li>Shutter</li>\r\n	<li>Aperture – fstop</li>\r\n	<li>ISO</li>\r\n	<li>Auto vs. Manual</li>\r\n	<li>Composition</li>\r\n	<li>Depth of Field</li>\r\n	<li>Observing your subject – Timing</li>\r\n	<li>Lighting – Heavy Contrast / Silhouettes / Soft Lighting</li>\r\n</ul>\r\n...and much more! Register below today!!\r\n\r\n[gravityform id=\"5\" name=\"Basics of Photography Workshop\" title=\"false\" description=\"false\"]',0,NULL,'00:00:00',NULL,0,0,1,NULL,NULL,'a:0:{}','2014-07-07 20:34:27','2014-07-09 07:39:44',0,NULL,NULL,NULL,NULL,0,NULL,0);
