INSERT INTO `wp_options` VALUES (80,'widget_text','a:4:{i:1;a:0:{}i:2;a:3:{s:5:\"title\";s:13:\"What is 1085?\";s:4:\"text\";s:153:\"1085 is a place for teaching and learning. It\'s a place that organizes Workshops & sells Books, and there\'s a lot more planned. All in downtown Scranton.\";s:6:\"filter\";b:1;}s:12:\"_multiwidget\";i:1;i:4;a:3:{s:5:\"title\";s:0:\"\";s:4:\"text\";s:475:\"<strong>What is 1085?</strong> If I were to put it simply, 1085 is a place for teaching and learning. There are lots of places online to learn and put out content, but I wanted more. I wanted an outlet where I could host workshops and sell books and bring people together. With 1085, I want to start something great. Hopefully this will grow into that something. Look around, but more importantly, keep coming back. There\'s lots of great stuff in store. - <i>Joe Casabona</i>\";s:6:\"filter\";b:1;}}','yes');
