INSERT INTO `wp_posts` VALUES (36,2,'2014-06-10 22:56:14','2014-06-11 02:56:14','<div id=\"book-splash\" class=\"group\">\r\n<div class=\"group\">\r\n<h3>The Web Designer\'s Guide to Google Glass</h3>\r\n<img class=\"alignleft size-medium wp-image-6909\" src=\"http://casabona.org/images/gg-cover-233x300.jpg\" alt=\"gg-cover\" width=\"233\" height=\"300\" /><strong>(ebook)</strong> This hands-on guide to optimizing web sites for Google Glass will show you how to take advantage of the latest advancements of this tiny screen, including watching videos and viewing forms. You’ll also take a look at the Mirror API and building web-based native apps for Google Glass, and get insightful tips from an expert designer on avoiding web design pitfalls.\r\n\r\nOther topics include looking at the design of the device, common terminology, web development, the Mirror API, and the future of Google Glass- how people use it and how they will use it. And the best part? It\'s <strong>only $5</strong>.\r\n<h3><strong><a class=\"button\" href=\"http://click.linksynergy.com/link?id=Pt0nqcHUWAg&amp;offerid=163295.2168359&amp;type=2&amp;murl=http%3A%2F%2Fwww.peachpit.com%2Ftitle%2F9780133845020\">Buy Now</a></strong></h3>\r\n</div>\r\n<div class=\"group\">\r\n\r\n<h3>Responsive Design with WordPress</h3>\r\n<a href=\"http://rwdwp.com\"><img class=\"alignright size-medium wp-image-6658\" src=\"http://casabona.org/images/rwdwp-cover-233x300.jpg\" alt=\"rwdwp-cover\" width=\"233\" height=\"300\" /></a>This book shows readers Responsive Web Design principles, and how to develop responsively when using WordPress. Estimates show that WordPress powers 20% of the web. With a greater push towards mobile, WordPress developers want to create responsive themes &amp; plugins.\r\n\r\nYou will learn to plan responsive layouts for common WordPress elements such as Archives, Search, Comments, Navigation Menus, and even Widgets. In addition you\'ll see how to account for common web elements that show up frequently in WordPress: forms, Google maps, tag clouds, and much more.\r\n<h3><strong><a class=\"button\" href=\"http://rwdwp.com\">Buy Now</a></strong></h3>\r\n</div>\r\n<h3>Building WordPress Themes from Scratch</h3>\r\n<a href=\"http://casabona.org/images/big-book.jpg\"><img class=\"alignleft size-medium wp-image-6300\" src=\"http://casabona.org/images/big-book-200x300.jpg\" alt=\"big-book\" width=\"200\" height=\"300\" /></a>\r\n\r\nIn my literary debut, I walk you through the steps you need to take in order to build your very own WordPress site. We will go through the entire creation process, from Themes to Plugins and more.From the moment I first started using WordPress about eight years ago, I fell in love with it straight away and immediately started hacking away at it, learning the platform, making my own changes, and watching it grow over the years.\r\n\r\nIn this book, I plan to teach you how to use WordPress, as well as how to leverage the API to create your own custom themes, plugins, and content types. In other words, I will show you how to make WordPress your own. As an added bonus, you will be able to download all of the files I talk about in the book to review and modify! <a title=\"Building WordPress Themes from Scratch FAQs\" href=\"http://casabona.org/2012/06/building-wordpress-themes-from-scratch-faqs/\">View FAQs</a>\r\n<h3><strong><a class=\"button\" href=\"http://wpthemesfromscratch.com\">Buy Now</a></strong></h3>\r\n</div>','Books','','publish','open','open','','books','','','2014-06-30 23:40:28','2014-07-01 03:40:28','',0,'http://1085.co/?page_id=36',0,'page','',0);
