INSERT INTO `wp_posts` VALUES (38,2,'2014-06-10 22:58:03','2014-06-11 02:58:03','The first event has been announced and is now live and ready for registration. The workshop, \"The Beginner\'s Guide to WordPress\" is taught by <a href=\"http://casabona.org/\">Joe Casabona</a> and will take you through how to use WordPress, from setting up a WordPress site, to creating posts and pages, to managing users and everything in between.\r\n\r\n<!--more-->\r\n\r\nThere are also two different types of tickets: A standard ticket, which will give you admission to the workshop, and an advanced ticket that will give you access to a set of videos produced by WP101 after the workshop is over. You will have access to these videos for up to 8 months. after the workshop is over.\r\n\r\nSo what are you waiting for? You can <a title=\"A Beginner’s Guide to WordPress\" href=\"http://1085.co/events/a-beginners-guide-to-wordpress/\">read more about the workshop here</a>, or you can use the form below to register!\r\n\r\n[gravityform id=\"1\" name=\"Intro WordPress Registration\" title=\"false\" description=\"false\"]','1st Event: The Beginner\'s Guide to WordPress Workshop','','publish','open','open','','1st-event-the-beginners-guide-to-wordpress','','','2014-06-17 16:27:24','2014-06-17 20:27:24','',0,'http://1085.co/?p=38',0,'post','',0);
