INSERT INTO `wp_posts` VALUES (45,2,'2014-06-11 19:46:29','2014-06-11 23:46:29','<img class=\"alignleft wp-image-47 size-thumbnail\" src=\"http://1085.co/wp-content/uploads/2014/06/casabona-circle-150x150.png\" alt=\"casabona-circle\" width=\"150\" height=\"150\" />Hi! Joe Casabona here. You might be wondering what exactly this is. If you\'ve seen my other places on the web, you\'ll know I already have a <a href=\"http://casabona.org\">personal blog and website</a>, a <a href=\"http://manifestdevelopment.com\">professional site with my services and portfolio</a>, as well as individual sites for  my books. I\'ve also gotten this question: \"What does <strong>1085</strong> mean? Does it have something to do with Scranton or learning?\" I\'d like to tell you it\'s a significant number, like the amount of hours I\'ve spent in web development, or the number of the house where I made my first website, but it\'s actually just the combination of my birth month and year. I can run with that, right? Some cool stuff happened in October 1985:\r\n\r\n<img class=\"alignnone size-full wp-image-62\" src=\"http://1085.co/wp-content/uploads/2014/06/tapes.jpg\" alt=\"Stack Of Audio Cassette Tape\" width=\"4100\" height=\"2435\" />\r\n<ul>\r\n	<li>The Free Software Foundation was started.</li>\r\n	<li>Nintendo\'s first American console, The NES launched.</li>\r\n	<li>...Bruno Mars was born.</li>\r\n</ul>\r\n\r\nAnyway, you get the idea. I put the two numbers together one day while doodling and I liked it. I decided to name this website, and soon this company, 1085 because I feel like it represents me pretty well. It\'s a place where people can teach and learn and that\'s a passion of mine. I wanted an outlet where I could <a title=\"Events\" href=\"http://1085.co/events/\"><strong>host workshops</strong></a> and <a title=\"Books\" href=\"http://1085.co/books/\"><strong>sell books</strong></a> and bring people together. With 1085, I want to start something great. I hope you\'ll keep stick around and visit often, and even participate. I\'m open to suggestions and others getting involved. <a title=\"Contact\" href=\"http://1085.co/contact/\">Just reach out</a>. Thanks for stopping by!\r\n\r\n<img class=\"alignnone wp-image-46 size-medium\" src=\"http://1085.co/wp-content/uploads/2014/06/sig-300x127.gif\" alt=\"sig\" width=\"300\" height=\"127\" />\r\n\r\nJoe Casabona','About 1085','','publish','open','open','','about','','','2014-06-30 23:06:15','2014-07-01 03:06:15','',0,'http://1085.co/?page_id=45',0,'page','',0);
