INSERT INTO `wp_posts` VALUES (53,2,'2014-06-29 14:31:40','2014-06-29 18:31:40','<h3>Some Important Notes:</h3>\r\n<ul>\r\n	<li>Everything here is copyright 1085 &amp; Joe Casabona unless otherwise noted.</li>\r\n	<li>Recommendations and references to other services might use affiliate links. Rest assured I wouldn\'t recommend a service that I don\'t use or haven\'t used myself.  It\'s also worth nothing that these links do not affect your purchase! You will not get charged more; vendors usually throw some percentage of the money they make from the link my way.</li>\r\n	<li>All payments are processed using Stripe. Don\'t worry, 1085 isn\'t storing your credit card information and all payments are processed securely.</li>\r\n	<li>1085 does not sell or otherwise give out the information that is stored to 3rd parties without your express written consent. You\'re info is safe here!</li>\r\n	<li>All fees are paid on a per item basis; that is there are currently (as of Jun 29th, 2014) no subscription-based fees. If you get charged more than once for the same event or product, <a title=\"Contact\" href=\"http://1085.co/contact/\">get in touch</a>.</li>\r\n	<li>Some partner content may have rules and restrictions for access. These will be clearly stated before access to the content is granted.</li>\r\n	<li>Check out the <a title=\"Refund Policy\" href=\"http://1085.co/refund-policy/\">Refund Policy</a>. Check the fine print, but the basics are: there is no refund on digital goods and there may be refunds on events.</li>\r\n</ul>','Legal Stuff','','publish','open','open','','legal-stuff','','','2014-06-29 14:39:44','2014-06-29 18:39:44','',0,'http://1085.co/?page_id=53',0,'page','',0);
INSERT INTO `wp_posts` VALUES (54,2,'2014-06-29 14:38:53','2014-06-29 18:38:53','<ul>\r\n	<li><strong>Digital Goods</strong>: There is no refund on digital goods. This included videos, ebooks, and any other downloadable content.</li>\r\n	<li><strong>Events: </strong>Events are refundable up to 24 hours before the event starts. In order to get a refund, <a title=\"Contact\" href=\"http://1085.co/contact/\">contact 1085 here</a>.\r\n<ul>\r\n	<li>If you were granted access to digital goods as part of an event purchase, you may only qualify for a partial refund.</li>\r\n</ul>\r\n</li>\r\n	<li><strong>Physical Goods: </strong>Physical goods are eligible for a refund up to 7 days after purchase. The refund will be processed after the product is mailed back to 1085 (instructions coming soon) and deemed to be in good (sellable) condition.</li>\r\n</ul>','Refund Policy','','publish','open','open','','refund-policy','','','2014-06-29 14:38:53','2014-06-29 18:38:53','',0,'http://1085.co/?page_id=54',0,'page','',0);
