INSERT INTO `wp_posts` VALUES (64,2,'2014-07-07 20:35:02','2014-07-08 00:35:02','In this One Day Workshop, <a href=\"http://phil.casabona.org\">Phil Casabona</a> will show you some Critical aspects of photography and camera information in order to take great photos. The focus will be on digital black and white photography and the Workshop will last around an hour and half, followed by taking some time downtown and on campus to take photos. Come by to learn all about:\r\n<ul>\r\n	<li>Shutter</li>\r\n	<li>Aperture – fstop</li>\r\n	<li>ISO</li>\r\n	<li>Auto vs. Manual</li>\r\n	<li>Composition</li>\r\n	<li>Depth of Field</li>\r\n	<li>Observing your subject – Timing</li>\r\n	<li>Lighting – Heavy Contrast / Silhouettes / Soft Lighting</li>\r\n</ul>\r\n...and much more! Register below today!!\r\n\r\n[gravityform id=\"5\" name=\"Basics of Photography Workshop\" title=\"false\" description=\"false\"]','Intro to Photography','','publish','closed','closed','','intro-photography','','','2014-07-09 07:39:43','2014-07-09 11:39:43','',0,'http://1085.co/?post_type=event&#038;p=64',0,'event','',0);
INSERT INTO `wp_posts` VALUES (68,3,'2014-07-15 14:58:18','2014-07-15 18:58:18','<em>By Phil Casabona</em>\r\n\r\nPhotography has come a long way over the past few years, advancing more recently than it has since its discovery in the mid 1820’s. Today anyone who has a cell phone or a point and shoot can start documenting their lives. For anyone who is interested in taking their photography interest, hobby, or passion a step further I intend to help you do so with this workshop. I will go over a few keys points and also teach you 10 easy steps to take a better picture.\r\n\r\n<!--more-->\r\n<ul>\r\n	<li> Acknowledge your environment</li>\r\n	<li>Acknowledge your lighting situation – natural or studio</li>\r\n	<li>Decide your desired effect or outcome</li>\r\n	<li>Observe your subject</li>\r\n	<li> Adjust your exposure triangle</li>\r\n	<li> Compose your image – in camera composition</li>\r\n	<li>Focus your subject – whole image / depth of field / motion</li>\r\n	<li>Timing – wait for the right moment / create the right moment / be prepared for the right moment</li>\r\n	<li>Press your shutter!!!</li>\r\n	<li>Adjust your shutter up 1 and down 1 and shoot same photo – compare exposures and helps familiarize you with your cameras ability.</li>\r\n</ul>\r\nIn <a title=\"Intro to Photography\" href=\"http://1085.co/events/intro-photography/\">this workshop</a> I will be teaching the in camera principles and techniques that make film photography such an art and helping you to understand and apply them to your digital photography. I will go over the exposure triangle, light, composition, in camera editing and cropping, timing, and honing your eye. I hope you will join me as I help you understand these concepts and help you apply them in your everyday shooting.\r\n<p style=\"text-align: center;\"><strong><a title=\"Intro to Photography\" href=\"http://1085.co/events/intro-photography/\">Join Phil for his Intro to Photography Workshop</a> on August 16th, 2014 in Downtown Scranton!</strong></p>\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;','10 Tips to Take Better Photos','','publish','open','open','','10-tips-take-better-photos','','','2014-07-16 07:01:32','2014-07-16 11:01:32','',0,'http://1085.co/?p=68',0,'post','',0);
INSERT INTO `wp_posts` VALUES (69,2,'2014-07-19 20:30:55','2014-07-20 00:30:55','<a href=\"http://1085.co/wp-content/uploads/2014/07/rwdwp-cover.jpg\"><img class=\"alignleft size-medium wp-image-70\" src=\"http://1085.co/wp-content/uploads/2014/07/rwdwp-cover-233x300.jpg\" alt=\"rwdwp-cover\" width=\"233\" height=\"300\" /></a>Responsive Design with WordPress shows readers Responsive Web Design principles, as well as how to develop responsively when using WordPress. With a greater push towards mobile and the emergence of Responsive Web Design (RWD), more and more WordPress developers are looking to create responsive themes for their websites. The book goes into detail, covering what default CSS classes WordPress uses and how to handle them when creating responsive designs. It shows how to implement the multiple images sizes and readers will learn to plan responsive layouts for common WordPress templates such as Archives, Search, Comments, how to find responsive friendly plugins, and more.\r\n\r\nFor a limited time, you can buy the book directly from Joe and get a personalized signed copy! Do it soon though, because quantities are limited!\r\n\r\n<article><strong>About the Author</strong>: Joe Casabona is a web developer, teacher, speaker, and writer currently working for the University of Scranton. He has been making websites since 2002, and using WordPress since 2004. He previously wrote Building WordPress Themes from Scratch for Rockable Press, and is interested in Star Wars, the Yankees, playing the drums, and cigars. See more at <a href=\"http://casabona.org/\">Casabona.Org</a>\r\n\r\n[gravityform id=\"4\" name=\"Responsive Design with WordPress\" title=\"false\" description=\"false\"]\r\n\r\n</article>','Get a Signed Copy of Responsive Design with WordPress!','','publish','open','open','','get-signed-copy-responsive-design-wordpress','','','2014-07-19 20:30:55','2014-07-20 00:30:55','',36,'http://1085.co/?page_id=69',0,'page','',0);
