INSERT INTO `wp_swp_testimonial` VALUES (1,'\\\"He presented well on Responsive Design and is very knowledgeable about the subject.\\\"','WordPress in Higher Ed','');
INSERT INTO `wp_swp_testimonial` VALUES (2,'The composition, design, format, and proposed implementation of the WordPress Development course’s online instructional materials were found to be outstanding in every aspect of preparation and delivery.','DECT ','');
INSERT INTO `wp_swp_testimonial` VALUES (3,'It bears further noting that the passion and enthusiasm of the author for the subject matter is made almost contagious through the tone and excitement he has brought to the instructional text. He has succeeded brilliantly in his ability to generate a level of excitement that will no doubt keep course students interested and involved... and even a little entertained.','DETC','');
INSERT INTO `wp_swp_testimonial` VALUES (4,'The written materials that frame and guide the WordPress Development course have been exceptionally crafted and beautifully formatted. Instructional materials were thoroughly reviewed and found to be easily accessed, well written, finely edited, and appropriately challenging.','DETC','');
INSERT INTO `wp_swp_testimonial` VALUES (5,'Joe Casabona was definitely the best speaker at the conference','WordCamp Attendee','');
INSERT INTO `wp_swp_testimonial` VALUES (6,'Joe is energetic, nice, funny, and good at what he does. He stays up to date with recent tech news and includes it in his material','Course Evaluation','');
INSERT INTO `wp_swp_testimonial` VALUES (7,'Professor Casabona never failed to add humor to his presentation, which help in enhancing his presentations. Always held my interest. His humor that he added to his presentation really helped me in learning the material better.','Course Evaluation','');
INSERT INTO `wp_swp_testimonial` VALUES (8,'One of the best professors when it comes to making student feel welcome in coming to him and seeking help.','Course Evaluation','');
INSERT INTO `wp_swp_testimonial` VALUES (9,'He was very easy to understand and condensed the information so that we could better learn it.','Course Evaluation','');
